import React, { Component } from "react";
import { Link } from "react-router-dom";

const style = {
  horizontal_list: {
    display: "inline"
  }
};

export class Menu extends Component {
  render() {
    return (
      <div>
        Adam Pikielny
        <ul>
          <li>
            <Link to="/code" style>
              Code
            </Link>
          </li>
          <li>
            <Link to="/videos">Videos</Link>
          </li>
          <li>
            <Link to="/photos">Photos</Link>
          </li>
        </ul>
      </div>
    );
  }
}

export default Menu;
